    func roundObjects() {
        for label in letterLabels {
            label.layer.masksToBounds = true
            label.layer.cornerRadius = 12
        }
        for button in keyButtons {
            button.layer.masksToBounds = true
            button.layer.cornerRadius = 5
        }
    }
    
    
    
    
