                p = p-1
            }
            p = p+1
        }
        var q = 0
        for letter in allTargetLets {
            if (fifthLetLabel.text != fifthTargetLet && letter == fifthLetLabel.text) {
                DispatchQueue.main.asyncAfter(deadline: .now() + 1.4) { [self] in
                    fifthLetLabel.backgroundColor = UIColor(named: "customYellow")
