                }
                allTargetLets.remove(at: q)
                q = q-1
            }
            q = q+1
        }
        
        
        //SET GREY TILES
        DispatchQueue.main.asyncAfter(deadline: .now() + 0.2) { [self] in
        if (firstLetLabel.backgroundColor != UIColor(named: "customGreen") && firstLetLabel.backgroundColor != UIColor(named: "customYellow")) {
